section3/gh_pages.html.body:
Gh-pages
GitHub Pages es un servicio de alojamiento gratuito que ofrece GitHub. 
Se permite alojar p&#xE1;ginas web est&#xE1;ticas.
Pasos a seguir mediante la rama gh-pages1- Crear una nueva rama denominada &quot;gh-pages&quot;2- Colocarse en la rama gh-pages3- A&#xF1;adir los cambios del proyecto en esta rama.


Pasos a seguir para una web de usuario o de una Organizaci&#xF3;n1- Crear un repositorio.Crear un nuevo repositorio denominado: &quot;username.github.io&quot;
 username debe ser exactamnte igual que su nombre de usuario en GitHub.2- Clonar el repositorioEn la carpeta en la que se desee desarrollar el proyecto, clonar el mismo desde el link de github.3- A&#xF1;adir cambiosDesarrollar cambios en el proyecto y subirlos al repositorio en GitHub.4. Listo!!Abre tu navegador y visita el enlace: &quot;username.gihub.io&quot;


