section4/gulp.html.body:
Gulp.js
Herramienta que automatiza y mejora nuestro flujo de trabajo. Su funci&#xF3;n principal reside en la automatizaci&#xF3;n
de tareas comunes de desarrollo, agilizando el tiempo por tanto el tiempo empleado por el desarrollador en realizar
tareas comunes manualmente.
Est&#xE1; construido con Javascript, funcionando sobre Node.js
Adem&#xE1;s, es de Open Source, de modo que su c&#xF3;digo fuente es accesible desde github a partir de este enlace.
Ventajas


Funcionamiento de Gulp.js1.- Instalaci&#xF3;n de Gulp.js$ npm install gulp --save-dev
Nota:Podemos verificar que gulp se ha instalado 
  correctamente ejecutando el siguiente comando:
$ gulp -v
2.- Creamos en nuestro proyecto el fichero gulpfile.js.3.- Instalamos y agregamos nuevas dependencias como, por ejemplo: gulp-concat, gulp-shell, gulp-uglify, ...
Podemos encontrar una lista de plugins de gulp haciendo click aqui4.- Configuramos cada tarea(task) que se desea automatizar, siguiendo
el esquema:/*
* Configuraci&#xF3;n de una tarea
*/
gulp.task(&apos;nombre_tarea&apos;, function () {
  // Contenido de la tarea &apos;demo&apos;
});
5.- Llamamos a la tarea previamente configurada desde consola$ gulp &quot;nombre_tarea&quot;



Enlaces e inter&#xE9;s1.- Ejemplo sencillo de creaci&#xF3;n de gulpfile
2.- Repositorio en Github de gulpjs


